import React from 'react';
import { useNavigate } from 'react-router-dom';

function Project1() {
  const navigate = useNavigate();

  const handleNext = () => {
    navigate('/project2');
  };

  return (
    <div className='Project1'>
      <h1>Project1</h1>
      <button onClick={handleNext}>Next</button>
    </div>
  );
}

export default Project1;
